in_source: |-
  (begin
      (defun print_string (begin x)
          (begin
              (while (== (deref x) 0)
                  (print (deref x))
                  (setq x (+ x 1))
              )
          )
      )

      (setq buf (alloc 200))
      
      (setq i 0)
      (setq ch input)
      (store (+ buf i) ch)
      (while (== ch 0)
          (setq i (+ i 1))
          (setq ch input)
          (store (+ buf i) ch)
      )

      (print_string "What is your name?\n")
      (print_string "Hello, ")
      (print_string buf)
      (print_string "!")
  )
in_stdin: |-
  Ivan
